#  Installation du raccourci $name
## &#x1F50E; Description:
Le raccourci Nutrition est composé de plusieurs raccourcis d'aide pour sa fonctionnalité étendue. Veuillez installer tous les raccourcis répertoriés dans la section Installer ci-dessous.
&nbsp;
Après l'installation, le raccourci principal à exécuter est Nutrition. Vous ne savez pas par où commencer ? Consultez le [tutoriel](https://iffy-pi.github.io/apple-shortcuts/versioning/nutrition/data/tutorial.html).
&nbsp;
Remarque : Assurez-vous de donner l'accès au raccourci pour lire et écrire des données de santé, reportez-vous à Autoriser l'accès à la santé dans le tutoriel.
&nbsp;
Remarque : si vous souhaitez utiliser les statistiques nutritionnelles, vous devez installer [Charty](https://apps.apple.com/ca/app/charty-for-shortcuts/id1494386093).
&nbsp;
Si vous rencontrez des erreurs ou des problèmes, veuillez contacter le développeur. (Voir le contact du développeur ci-dessous)
